import './style.css';
import filtro from '../../assests/filtro.svg'


function Filters() {
    return (
        <div>
            <button className='btn-filter'>
                <img src={filtro} alt='filter' />
                <strong>Filtrar</strong>
            </button>
        </div>
    )
};

export default Filters;
